import React, {useState} from 'react'
import Member from './Member'

function Crew(props){
    function addMembers(){
        props.callback(props.id)
        
    }
    const members = props.members.map((item, i) => <Member key={i} name={item} />)
    return(
        <div onClick={addMembers} className="crew">
            <p>{props.id}</p>
            {members}
        </div>
    )
}
export default Crew
